document.getElementById("formEditEmpleado").addEventListener("submit",function(t){t.preventDefault(),Swal.fire({title:"¿Estás seguro?",text:"¿Quieres confirmar la edición?",icon:"warning",showCancelButton:!0,confirmButtonColor:"#3085d6",cancelButtonColor:"#d33",confirmButtonText:"Sí, editar!"}).then(t=>{t.isConfirmed&&(this.submit(),setTimeout(function(){location.reload()},1e3))})});